"use strict";(self.webpackChunk_genesislcap_docs=self.webpackChunk_genesislcap_docs||[]).push([[48695],{22208:function(e){e.exports=JSON.parse('{"label":"use cases","permalink":"/tags/use-cases","allTagsPath":"/tags","count":3,"items":[{"id":"version-2022.3/getting-started/use-cases/loading-feed-data/example-source-data","title":"Loading feed data - Example source data","description":"Here is an edited example of a source file of issuance data from the Bloomberg feed.","permalink":"/getting-started/use-cases/loading-feed-data/example-source-data"},{"id":"version-2022.3/getting-started/use-cases/loading-feed-data/overview","title":"Loading feed data - How to load feed data into an application","description":"Some feeds provide static sets of data that you can download for processing by your application. A good example is traded data from an exchange. This exercise shows you the key points for loading these data files. In this case, we shall use Bloomberg issuance data. We shall load this, parse it to reformat it to Genesis format, then place it in a staging table in a Genesis application. Once it is in the staging table, the data can be passed to other tables within the application.","permalink":"/getting-started/use-cases/loading-feed-data/overview"},{"id":"version-2022.3/getting-started/use-cases/loading-feed-data/sftp-and-encryption","title":"Loading feed data - SFTP and encryption","description":"If you are loading static data from an external site, this page gives more detail on the SFTP method for obtaining the data. It also looks at how you could deal with encryption and decryption in higher environments.","permalink":"/getting-started/use-cases/loading-feed-data/sftp-and-encryption"}]}')}}]);